import mockApi from './mockApi';

export const progressService = {
  // Progress Entries
  async getEntries() {
    const { data } = await mockApi.getProgress();
    return data;
  },

  async createEntry(entry) {
    const { data } = await mockApi.addProgressEntry(entry);
    return data;
  },

  async updateEntry(id, entry) {
    // Mock update - in real app this would update the entry
    const { data } = await mockApi.addProgressEntry({ ...entry, id });
    return data;
  },

  async removeEntry(id) {
    // Mock delete - in real app this would remove the entry
    return { data: { message: 'Entry deleted successfully' } };
  },

  // Goals
  async getGoals() {
    // Mock goals data
    return { data: [] };
  },

  async createGoal(goal) {
    // Mock goal creation
    return { data: { ...goal, id: Date.now() } };
  },

  async updateGoal(id, goal) {
    // Mock goal update
    return { data: { ...goal, id } };
  },

  async removeGoal(id) {
    // Mock goal deletion
    return { data: { message: 'Goal deleted successfully' } };
  }
};

export default progressService;
